import React, { Component } from "react";
import "./App.css";

class Image extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { imgSrc } = this.props;
    return (
      <div className="Image">
      <Image 
          imgSrc="https://user-images.githubusercontent.com/15258799/57022768-4612bb80-6c5a-11e9-820d-9f0532f92303.gif"
          />
        <img src={imgSrc} />
      </div>
    );
  }
}

export default Image;
